const obtenerPalabras = async (categoria) => {
    const vocabulario = {
      vocabulario: [
        { palabraEsp: "Hola", palabraSue: "Hej" },
        { palabraEsp: "Gracias", palabraSue: "Tack" },
        { palabraEsp: "Adiós", palabraSue: "Hejdå" },
      ],
      verbos: [
        { palabraEsp: "Comer", palabraSue: "Äta" },
        { palabraEsp: "Correr", palabraSue: "Springa" },
      ],
      adjetivos: [
        { palabraEsp: "Grande", palabraSue: "Stor" },
        { palabraEsp: "Pequeño", palabraSue: "Liten" },
      ],
      "ett eller en": [
        { palabraEsp: "Mesa", palabraSue: "Ett bord" },
        { palabraEsp: "Manzana", palabraSue: "Ett äpple" },
      ],
    };

    return vocabulario[categoria] || [];
  };

  export default obtenerPalabras;
